import React from 'react';
import {Button} from 'react-bootstrap';
import '../../scss/Menu.scss';
import {Link} from 'react-router-dom';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {faHome, faUsers, faUser, faPowerOff} from "@fortawesome/free-solid-svg-icons";
import logoWhite from '../../Assets/logoWhite.png';
import {isLogged} from "../../api/Login";

const Menu = (props) => {
    const {setCheckLogin} = props;
    const logOut = () =>{
        setCheckLogin(true);
    }
    return (
        <div className="menu">
            <img className="logo" src={logoWhite} alt="Logo Menu" />
            <Link to="/">
                <FontAwesomeIcon icon={faHome} /> Inicio
            </Link>
            <Link to="/users">
                <FontAwesomeIcon icon={faUsers} /> Usuarios
            </Link>
            <Link to="/profile">
                <FontAwesomeIcon icon={faUser} /> Perfil
            </Link>
            <Link to="" onClick={logOut} >
                <FontAwesomeIcon icon={faPowerOff} /> Cerrar Sesi√≥n
            </Link>
            <Button variant="primary">Tweetear</Button>
        </div>
    );
}
export default Menu;
